class Solution(object):
    def lastVisitedIntegers(self, words):
        """
        :type words: List[str]
        :rtype: List[int]
        """
        result = []
        nums = []
        prev_count = 0

        for word in words:
            if word.isdigit():
                nums.append(int(word))
                prev_count = 0
            else:  # word == "prev"
                prev_count += 1
                if prev_count <= len(nums):
                    result.append(nums[-prev_count])
                else:
                    result.append(-1)
        return result
